import React from "react";
import { Container, Navbar as NavbarComp, Nav , Button} from "react-bootstrap";
import { Link } from "react-router-dom";
import booksLogo from "../../assets/books-logo.png";
import Login from "../modal/Login";
import Register from "../modal/Register";

function Navbar(props) {
  return (
    <NavbarComp expand="lg">
      <Container>
        <NavbarComp.Brand as={Link} to="/">
          <img
            src={booksLogo}
            className="img-fluid rounded rounded-5"
            style={{ width: "60px", height: "60px" }}
            alt="brand"
          />
        </NavbarComp.Brand>
        <NavbarComp.Toggle aria-controls="basic-navbar-nav" />
        <NavbarComp.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Button
              onClick={Login}
              className="btn-outline-dark me-3 f-2 fw-bold"
            >
              Login
            </Button>
            <Nav.Link
              onClick={Register}
              className="btn btn-dark text-light f-2 fw-bold"
            >
              Register
            </Nav.Link>
          </Nav>
        </NavbarComp.Collapse>
      </Container>
    </NavbarComp>
  );
}

export default Navbar;
